import os
import sys
import time

if sys.argv[1]=='bashrc':
    if os.path.isfile('/tmp/status'): sys.exit()
    else: os.system('printf _kodi > /tmp/status')

if sys.argv[1]=='loop': os.system('printf menu > /tmp/status')

if 'DISPLAY' not in os.environ:
    os.environ['DISPLAY'] = ':0'

if sys.argv[1]=='bashrc' or sys.argv[1]=='loop':

    from threading import Thread
    import subprocess

    os.system('clear')

    def cec_netflix(key, speed):
        if key == 'up':
            os.system(f'eval $(xdotool getmouselocation --shell); if [ "$Y" -lt 50 ]; \
                      then xdotool key Up; else xdotool mousemove_relative -- 0 -{speed}; fi')
        elif key == 'left': os.system(f'xdotool mousemove_relative -- -{speed} 0')
        elif key == 'down':
            os.system(f'eval $(xdotool getmouselocation --shell); if [ "$Y" -gt 670 ]; \
                      then xdotool key Down; else xdotool mousemove_relative -- 0 {speed}; fi')
        elif key == 'right': os.system(f'xdotool mousemove_relative -- {speed} 0')
        elif key == 'select': os.system('xdotool click 1')
        elif key == 'exit': os.system('killall -s 15 Xorg')
        elif key == 'pause': os.system('xdotool key space')
        elif key == 'play': os.system('xdotool key space')
        elif key == 'stop': os.system('xdotool key F5')
        elif key == 'rewind': os.system('xdotool key Left')
        elif key == 'Fast': os.system('xdotool key Right')

    def cec_retropie(key):
        if key=='exit':
            pid = os.popen('pidof /opt/retropie/emulators/retroarch/bin/retroarch').read().strip()
            if pid.isdigit(): os.system('kill -15 '+pid)
            else: os.system('killall -s 15 /opt/retropie/supplementary/emulationstation/emulationstation')

    def cec_menu(key):
        if key == 'left': os.system('xdotool key Shift+Tab')
        elif key == 'right': os.system('xdotool key Tab')
        elif key == 'select': os.system('xdotool key space')
        elif key == 'exit': os.system('xdotool key Escape')

    def threaded_function():
        proc = subprocess.Popen(['cec-client'], stdout=subprocess.PIPE)
        prev_time = time.time()
        speed=20
        while proc.poll() is None:
            line = str(proc.stdout.readline())
            program = open('/tmp/status').read()
            if 'pressed' in line and 'duration' in line:
                key = line.split('pressed: ')[1].split(' ')[0]
                if key in "left right up down": now = time.time()
                if now-prev_time<0.5: speed+=20
                else: speed=20
                if program=='menu': cec_menu(key)
                elif program in ' '.join(['prime', 'spotify', 'netflix', 'disney']): cec_netflix(key, speed)
                elif program=='retropie': cec_retropie(key)
                if key in "left right up down": prev_time = now

    Thread(target = threaded_function).start()
    while True:
        program = open('/tmp/status').read()
        os.system(f"{program[1:] if program[0] == '_' else f'startx /usr/bin/python3 /home/pi/menu.py {program} --'} > /dev/null 2>&1; {'' if program=='menu' else 'printf menu > /tmp/status'}")

    os.system('killall -s 15 cec-client')

elif sys.argv[1] == 'menu':

    from tkinter import *
    root = Tk()

    background_gif = PhotoImage(data = '')
    desktop_gif = PhotoImage(data = '')
    spotify_gif = PhotoImage(data = '')
    kodi_gif = PhotoImage(data = '')
    retropie_gif = PhotoImage(data = '')
    netflix = PhotoImage(data = '')
    disney_gif = PhotoImage(data = '')
    prime_gif = PhotoImage(data='')
    deluge_on_gif = PhotoImage(data = '')
    deluge_off_gif = PhotoImage(data = '')
    nordvpn_gif = PhotoImage(data = '')
    nordvpn_on_gif = PhotoImage(data = '')
    nordvpn_usa_gif = PhotoImage(data ='')
    nordvpn_ita_gif = PhotoImage(data ='')
    nordvpn_off_gif = PhotoImage(data ='')

    os.system('xrandr -s 1280x720 -r 60')

    def quit_(event):
        os.system('killall python3')

    def write_status(msg):
        os.system('printf ' + msg + ' > /tmp/status')
        root.destroy()

    def toggle_deluge(button):
        pid = os.popen('pidof /usr/bin/deluge-web -x').read().strip()
        if pid.isdigit():
            os.system('kill -s 15 '+ pid)
        else:
            os.system('nohup deluge-web  > /dev/null 2>&1 &')
        to_use = deluge_off_gif if pid.isdigit() else deluge_on_gif
        button.configure(image = to_use)

    def new_button(frame, pic, func, padx=5, pady=(0,45)):
        to_return = Button( frame,
                            command = func,
                            image = pic,
                            width = 100, height = 100, bg='white',
                            highlightthickness=3, highlightbackground='white',
                            relief='flat'
                         )
        to_return.image = pic
        to_return.pack(padx=padx, pady=pady, side='left')
        return to_return

    def ovpn_is_connected():
        return os.popen('ifconfig -s tun0 2> /dev/null').read().strip().split()[-5].isdigit()

    def vpn_window(frame, button):
        t = Toplevel(frame, bg='white')
        t.overrideredirect(1)
        t.focus_force()
        t.geometry(f'360x120+{button.winfo_rootx()-125}+{button.winfo_rooty()-120}')

        def close_submenu(event):
            t.destroy()
            frame.focus_force()

        def launch_vpn(country_id):
            os.system('sudo killall -s 15 openvpn  > /dev/null 2>&1')
            while ovpn_is_connected(): pass # wait for openvpn to close
            button.configure(image = nordvpn_gif)
            if country_id == 0:
                close_submenu(None)
                return
            # get lowest load server id
            conf_file = os.popen(f'curl -s "https://api.nordvpn.com/v1/servers/recommendations?limit=1&filters%5Bcountry_id%5D={country_id}"').read().strip().split('hostname":"')[1].split('","load')[0]
            #download server configuration file for openvpn
            os.system(f'wget -qP /tmp https://downloads.nordcdn.com/configs/files/ovpn_legacy/servers/{conf_file}.tcp443.ovpn')
            os.system(f'sudo -b openvpn --config /tmp/{conf_file}.tcp443.ovpn --auth-user-pass auth.txt  > /dev/null 2>&1')
            time_start = time.time()
            while not ovpn_is_connected(): # wait for openvpn to connect
                if time.time() - time_start > 30: # timeout
                    #change to failed
                    break
            else:
                button.configure(image = nordvpn_on_gif)
                close_submenu(None)

        t.bind('<Escape>', close_submenu)
        new_button(t, nordvpn_usa_gif, lambda: launch_vpn(228), pady=0) # United States
        new_button(t, nordvpn_ita_gif, lambda: launch_vpn(106), pady=0) # Italy
        new_button(t, nordvpn_off_gif, lambda: launch_vpn(0), pady=0)   # close
        
    #root.config(cursor='arrow')
    root.geometry('1281x721')
    root.bind('<Alt-F4>', quit_)

    background_label = Label(root, image=background_gif)
    background_label.place(x=0, y=0, relwidth=1, relheight=1)

    frame = Frame(root, bg='white')
    frame.pack(side='bottom')

    new_button(frame, desktop_gif, lambda: write_status('_startx'))
    new_button(frame, kodi_gif, lambda: write_status('_kodi'))
    new_button(frame, netflix, lambda: write_status('netflix'))
    new_button(frame, disney_gif, lambda: write_status('disney'))
    new_button(frame, prime_gif, lambda: write_status('prime'))
    new_button(frame, spotify_gif, lambda: write_status('spotify'))
    new_button(frame, retropie_gif, lambda: write_status('_emulationstation'))

    proxy_button = new_button(frame, nordvpn_on_gif if os.popen('pidof openvpn').read().strip().isdigit() else nordvpn_gif,
                              lambda: vpn_window(frame, proxy_button))
    deluge_button = new_button(frame, deluge_on_gif if os.popen('pidof /usr/bin/deluge-web -x').read().strip().isdigit() else deluge_off_gif,
                               lambda: toggle_deluge(deluge_button))

    root.mainloop()


if sys.argv[1] in ' '.join(['prime', 'spotify', 'netflix-italy', 'netflix-usa', 'disney']):

    user_agent = "'Mozilla/5.0 (X11; CrOS armv7l 11895.95.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/74.0.3729.125 Safari/537.36'"

    if 'spotify' in sys.argv[1]:   url = "https://open.spotify.com/"
    elif 'netflix' in sys.argv[1]: url = "https://www.netflix.com/"
    elif 'disney' in sys.argv[1]:  url = "https://www.disneyplus.com/"
    elif 'prime' in sys.argv[1]:  url = "https://www.primevideo.com/"

    os.system("xrandr -s 1280x720 -r 60")
    os.system('xdotool mousemove 640 360')
    os.system("compton &")
    os.system(f"chromium-browser --kiosk --noerrdialogs --disable-infobars --window-position=0,0 --window-size=1281,721 --user-agent={user_agent} {url}")

elif sys.argv[1] == '':
    pass
